import React, { Component } from 'react';
import PropTypes from 'prop-types';

import { withToastManager } from 'react-toast-notifications';

import { faTimes } from "@fortawesome/free-solid-svg-icons";

import {
  Modal,
  ModalContent,
  ModalHeader,
  ModalFooter,
  Title,
  Button,
} from 'shipnow-mercurio';

import {
  Level,
  LevelLeft,
  LevelRight,
} from 'bloomer';

class UsersEditModal extends Component {

  modifiedUser

  constructor(props) {
    super(props);

  }

  getUser() {
    if (this.modifiedUser) {
      return this.modifiedUser;
    }
    else {
      this.modifiedUser = this.props.user.clone();
      return this.modifiedUser;
    }
  }

  render() {
    const user = this.getUser()
    return(
      <Modal show>
        <ModalHeader>
          <Level>
            <LevelLeft>
              <Title>Modificar usuario</Title>
            </LevelLeft>
            <LevelRight>
              <Button kind="link" icon={ faTimes } onClick={ this.handleClose } />
            </LevelRight>
          </Level>
        </ModalHeader>
        <ModalContent>
          <ProfessionalsForm onChange={ this.handleChange } professional={ professional } />
        </ModalContent>
        <ModalFooter>
          <Level>
            <LevelLeft></LevelLeft>
            <LevelRight>
              <Button disabled={ !this.getDisabled() } onClick={ this.handleSave }>Guardar</Button>
              <Button kind="outline" onClick={ this.handleClose }>Cancelar</Button>
            </LevelRight>
          </Level>
        </ModalFooter>
      </Modal> )
  }
}

UsersEditModal.PropTypes = {
  user: PropTypes.object,
}

UsersEditModal.defaultProps = {
  user: null
}

export default withToastManager(UsersEditModal);
